import quizQuestions from '.quizQuestions';

import Question from "../components/question";
import { Component } from "react";

class Index extends Component {
    constructor(props) {
        super(props);

        this.state = {
            counter: 0,
            questionId: 1,
            question: '',
            answerOptions: [],
            answer: '',
            answersCount: {},
            result: ''
        };
    }

    componentDidMount() {
        const shuffledAnswerOptions = quizQuestions 
    }

    render() {
       return( 
            <div className="App">
                <div className="App-Header">
                    <h2>React Quiz</h2>
                </div>
                <Question content="Is this working"/>
            </div>
        );
    }
}

export default Index;
